import React from 'react';
import { useParams } from 'react-router-dom';

export const PropertyDetail = () => {
  const { id } = useParams();

  // Dummy property data
  const propertyDetails = {
    1: { 
      title: 'Olivia Court', 
      location: 'Lekki, Lagos', 
      description: 'Details about Olivia Court', 
      image: 'img/01-large.jpg',
      video: 'https://www.youtube.com/embed/samplevideo1',
      breadcrumbs: 'Home > Project > Olivia Court'
    },
    // Additional property details...
  };

  const property = propertyDetails[id];

  if (!property) {
    return <div>Property not found.</div>;
  }

  return (
    <div className="property-detail-page">
      <header className="property-header" style={{ backgroundImage: `url(${property.image})` }}>
        <div className="property-header-content">
          <nav className="breadcrumb">{property.breadcrumbs}</nav>
          <h1 className="property-title">{property.title}</h1>
          <h2 className="property-location">{property.location}</h2>
          <div className="cta-button">
            <a href="/projects" className="see-projects-btn">See All Projects</a>
          </div>
        </div>
        <div className="header-top-right">
          <div className="contact-info">
            <span>+234 912 500 0558</span>
            <div className="social-icons">
              <i className="fab fa-facebook"></i>
              <i className="fab fa-twitter"></i>
              <i className="fab fa-instagram"></i>
            </div>
            <a href="/contact" className="message-btn">Send Us a Message</a>
          </div>
        </div>
      </header>

      {/* Rest of the property detail section */}
      <div className="property-body">
        <iframe
          width="100%" 
          height="315" 
          src={property.video}
          frameBorder="0"
          allowFullScreen
          title={property.title}
        />
        <p>{property.description}</p>
      </div>
    </div>
  );
};

export default PropertyDetail;
